import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';
import './navstyle.css';
import $ from 'jquery';

class Nav extends Component {

  componentDidMount = () => {
    $(document).ready(function() {
      $(window).scroll(function() {
        if ($(document).scrollTop() > 500) {
          console.log('hello');
          $(".navbar").addClass("test");
          $
        } else {
           $(".navbar").removeClass("test");
    }
    });
  });
    }


  render(){
   return (
      <div className='navbar'>
      <h2 style={{paddingLeft:30}}>Anjali</h2>
      <div style={{position:'absolute',left:800}}>
       <Link
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Homepage</span></Link>
       <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      ><span className='heading'>About</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="skills"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Skills</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Resume</span></Link>
      <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Portfolio</span></Link>
       <Link
          style={{marginLeft:20}}
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='heading'>Contact</span></Link>
     </div>
      
  </div>
    );
  }
}

export default Nav;
